import React from "react";
import "../pricegraph/pricegraph.css";
import { Bar } from "react-chartjs-2";

const Pricegraph = ({ data }) => {
  let key = [];
  let val = [];
  for (let v of Object.keys(data["allLocCount"])) {
    key.push(v);
    val.push(data["allLocCount"][v]);
  }
  console.log(key);
  console.log(val);
  return (
    <div className="bargraph">
      <div>
      <BarChart
          width={500}
          height={300}
          data={data}
          margin={{
            top: 5,
            right: 30,
            left: 80,
            bottom: 5,
          }}
          barSize={20}
        >
          <XAxis
            dataKey="name"
            scale="point"
            padding={{ left: 10, right: 10 }}
          />
          <YAxis />
          <Tooltip />
          <Legend />
          <CartesianGrid strokeDasharray="3 3" />
          <Bar dataKey="users" fill="#8884d8" background={{ fill: "#eee" }} />
        </BarChart>
    </div>
    </div>
  );
};

export default Pricegraph;
